select(2, ...).LoadData("APP_INFO","Global",[[return {version=403,lastSync=1582624187,message={id=0,msg=""},news={{title="TradeSkillMaster v4.9.27 Changelog",content="TSM v4.9.27 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Fixed error when using the default UI or another AH addon while TSM is scanning<br />* [Retail] Added new bonusIds<br />* [Retail] Fixed issue with some armor subclass filters<br />* [Retail] Fixed issue with posting pets<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1582561818,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-27-changelog/"},{title="TradeSkillMaster v4.9.26 Changelog",content="TSM v4.9.26 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed login error caused by conflict with VuhDo<br />* Fixed error when closing the mailbox during sending of mail<br />* Added warning message for old TSM modules<br />* [Retail] Some optimizations for working around internal auction errors<br />* [Retail] Fixed error when closing the Auctioning UI while posting / canceling<br />* [Retail] Fixed error when scanning artifact relic gems<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1581698672,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-26-changelog/"},{title="TradeSkillMaster v4.9.25 Changelog",content="TSM v4.9.25 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Some additional scanning optimizations for filtering by item level<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1581356803,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-25-changelog/"},{title="TradeSkillMaster v4.9.24 Changelog",content="TSM v4.9.24 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Fixed issue with invalid pets in groups<br />* [Retail] Fixed issue with Sniper scanning the base group even when it has no operation<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1581306465,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-24-changelog/"},{title="TradeSkillMaster v4.9.23 Changelog",content="TSM v4.9.23 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* The sniper sound will now play when changing the option<br />* Fixed error when holding shift while removing items from a top-level group<br />* Optimized login and logout times<br />* [Retail] Removing invalid battlepets from groups to fix some errors<br />* [Retail] Added new bonusIds<br />* [Retail] Fixed some issues with Sniper<br />* [Retail] Optimized filter-based AH queries (including Sniper)<br />* [Retail] Fixed conflict with other addons which use the AH<br />* [Retail] Added chat message when other addons slow down TSM scans<br />* [Retail] Showing popup message if the WoW client is out of date<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1581295080,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-23-changelog/"},{title="TradeSkillMaster v4.9.22 Changelog",content="TSM v4.9.22 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Ignoring errors from BugGrabber for now<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1580930753,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-22-changelog/"},{title="TradeSkillMaster v4.9.21 Changelog",content="TSM v4.9.21 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Fixed occasional error when searching the AH<br />* [Retail] Fixed error when buying auctions<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1580926895,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-21-changelog/"},{title="TradeSkillMaster v4.9.20 Changelog",content="TSM v4.9.20 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed issue with destroy price source giving incorrect results for craftable items<br />* Improved UX around invalid filter-based Shopping searches<br />* Fixed issue with setting up account sync not working<br />* Added validation that the craft value within a Crafting operation does not reference the crafting price source<br />* Fixed issue with logging out switching profiles<br />* Fixed a memory leak in the Vendor UI<br />* [Retail] Added workaround for Blizzard 8.3 bug with Jewelcrafting which was causing fps issues with TSM<br />* [Retail] Completely overhauled how TSM interacts with the 8.3 AH APIs to improve reliability and logging<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1580922191,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-20-changelog/"},{title="TradeSkillMaster to power Classic AH Database by NexusHub",content="We're very happy to announce our partnership with NexusHub, to provide Auction House data for a brand new Classic WoW AH Database. Through the NexusHub, you can monitor and report on current item prices on the Classic WoW Auction House as well as dive in to pricing history for all realms and factions in both [...]",timestamp=1580684440,link="https://blog.tradeskillmaster.com/tradeskillmaster-to-power-classic-ah-database-by-nexushub/"},{title="TradeSkillMaster v4.9.19 Changelog",content="TSM v4.9.19 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed error when closing Mailing UI while sending.<br />* Fixed error from Shopping UI.<br />* The Auctioning log will now update appropriately after manually editing the buyout price.<br />* Fixed issue with auction scrolling tables not being sorted properly in some situations.<br />* Fixed UI issue with Shopping scan progress briefly showing the wrong page.<br />* Optimized profession scanning code.<br />* Optimized custom price code and fixed some issues which lead to &#8220;script ran too long&#8221; errors.<br />* [Retail] Fixed issue with Shopping not being able to find auctions.<br />* [Retail] Fixed issue with manually changing buyout price in Auctioning for commodities.<br />* [Retail] The bid field is now properly non-editable when posting commodities through Auctioning.<br />* [Retail] Added bonusIds for corruption information.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1580142615,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-19-changelog/"}}}]]) --<APP_INFO,Global,1582624187>
